// import Translate from "../../../Translate";
// import AddButton from "../../../components/buttons/addButton";


class UserContainer extends Component {
    constructor(props) {
        super(props)
        this.props.getCategories()

    }
    toggle() {
        // this.props.userModal("add",!this.props.modal.add)
    }

    render() {
        if(this.props.categories.length){
            return(
                <Col sm="12">
                    <Card>
                        <CardBody>
                            {/*<TableComponent data = { this.props.categories } perm={ this.props.categoryPerm } handle = { this.props.handle }/>*/}
                            <ReactFoldableTableSource data = {this.props.categories} />
                        </CardBody>
                    </Card>
                </Col>

            )
        }else{
            return(
                <Col sm="12">
                    <Card>
                        <CardBody>
                            {/*<TableComponent data = { this.props.categories } perm={ this.props.categoryPerm } handle = { this.props.handle }/>*/}
                            {/*<ReactFoldableTableSource data = {this.props} />*/}
                        </CardBody>
                    </Card>
                </Col>

            )
        }

    }
}


export default UserContainer;
